-- Table Setup

IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'Flood_Depth_Data') AND type in (N'U'))
BEGIN
    CREATE TABLE Flood_Depth_Data (
        id INT IDENTITY(1,1) PRIMARY KEY NOT NULL,
        depth_class INTEGER NOT NULL UNIQUE,
        depth_min INTEGER,
        depth_max INTEGER
    )
END
;
GO

IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'Flood_Map_Data') AND type in (N'U'))
BEGIN
    CREATE TABLE Flood_Map_Data (
        id INT IDENTITY(1,1) PRIMARY KEY NOT NULL,
        polygon_id INTEGER NOT NULL,
        time DATETIMEOFFSET NOT NULL DEFAULT SYSDATETIMEOFFSET(),
        flooded INTEGER NOT NULL,
        depth_class INTEGER NOT NULL,
        geometry GEOMETRY NOT NULL                             
    );
END
;
GO

-- Populating Depth Lookup Table
IF NOT EXISTS (SELECT 1 FROM Flood_Depth_Data WHERE depth_class = 0) INSERT INTO Flood_Depth_Data (depth_class, depth_min, depth_max) VALUES (0, 0, 1);
IF NOT EXISTS (SELECT 1 FROM Flood_Depth_Data WHERE depth_class = 1) INSERT INTO Flood_Depth_Data (depth_class, depth_min, depth_max) VALUES (1, 1, 2);
IF NOT EXISTS (SELECT 1 FROM Flood_Depth_Data WHERE depth_class = 2) INSERT INTO Flood_Depth_Data (depth_class, depth_min, depth_max) VALUES (2, 2, 3);

GO
